import Layout from "../components/Layout";

class Retrive extends React.Component {
  constructor() {
    super();
    this.state = {
      songs: []
    };
  }

  async componentWillMount() {
    fetch("http://example.com/movies.json")
      .then(response => {
        return response.json();
      })
      .then(data => {
        console.log(data);
        console.log("hello");
      });
  }

  render() {
    return (
      <Layout>
        <div>{this.state.songs}</div>
      </Layout>
    );
  }
}

export default Retrive;
